$(function() {
	$("#paihang").click(function() {
		$(this).colorbox({
			iframe: true,
			width: "90%",
			height: "90%"
		});
		tusi('点击排行选手名可直达哦');
	});
	$("#cjdzp").click(function() {
		$(this).colorbox({
			iframe: true,
			width: "90%",
			height: "90%"
		});
	})
});

function setload() {
	var div = $('.load');
	div.css('zIndex', 99999999);
	div.css('display', 'block');
	div.css('left', parseInt(($(window).width() - div.width()) / 2));
	var top = parseInt(($(window).height() - div.height()) / 2);
	div.css('top', top);
}

function tusi(txt, lh, pt, ti, fun) {
	if(!ti) ti = 3000;
	if(!lh) lh = 77;
	if(!pt) pt = 0;
	$('.tusi').remove();
	var div = $('<div style="background: url(' + '/@system/img/tusi.png' + ') no-repeat;max-width: 85%;min-height: 77px;min-width: 270px;position: fixed;left: -1000px;top: -1000px;text-align: center;border-radius:10px;"><p style="color: #ffffff;line-height: ' + lh + 'px;font-size: 2em;padding-top:' + pt + 'px;">' + txt + '</p></div>');
	$('body').append(div);
	div.css('zIndex', 9999999);
	div.css('left', parseInt(($(window).width() - div.width()) / 2));
	var top = parseInt(($(window).height() - div.height()) / 2);
	div.css('top', top);
	setTimeout(function() {
		div.remove();
		if(fun) {
			fun();
		}
	}, ti);
}

function loadImage(url, id) {
	if($("#inline_content" + id).attr("done") == "yes") {
		$(".load").css("display", "none");
		light(id);
		return;
	};
	$("#sfxsfx").html("加载选手信息中");
	setload();
	var rightimgh;
	var rightimgw;
	w = $(window).width() - 60;
	$.each($("#inner" + id + " img"), function(k, v) {
		var thisimg = $(this);
		var img = new Image();
		img.src = thisimg.attr('dsrc');
		img.onload = function() {
			thisimg.attr('src', thisimg.attr('dsrc'));
			if(thisimg.attr('id') == "bigimg" + id) {
				rightimgh = img.height;
				rightimgw = img.width;
			};
			thisimg.css("width", w);
			thisimg.css("height", (w * img.height) / img.width);
		}
	});
	var $images = $("#inner" + id + " img");
	var preloaded = 0;
	var total = $images.length;
	$images.load(function() {
		if(++preloaded === total) {
			$("#inline_content" + id).attr("done", "yes");
			$(".load").css("display", "none");
			light(id);
			return;
		}
	});
}

function loadyzm(name, par) {
	$(".btn").each(function() {
		var abss = $(this).attr("meid");
		if(abss == name) {
			$(this).trigger("click");
		}
	});
}

function reloadpage(name, par) {
	window.location.reload();
}

function ajaxvote(id, name, wid, pid, key, code) {
	if($("#video" + name).length > 0 && $("#colorbox").css("display") == "block") $("#cboxClose").trigger("click");
	$("#sfxsfx").html("努力提交中");
	setload();
	$.ajax({
		url: "/wx/picwv-vote.html",
		type: 'post',
		dataType: "json",
		data: {
			id: id,
			wid: wid,
			pid: pid,
			key: key,
			code: code
		},
		success: function(d) {
			if(!d.code) {
				tusi("网络错误");
				return false;
			};
			$(".load").css("display", "none");
			eval(d.alertfun + '("' + d.cont + '")');
			if(d.code == 1) {
				$("#acount").html(parseInt($("#acount").html()) + 1);
				$(".count").each(function() {
					var ab = $(this).attr("meid");
					if(ab == name) $(this).html(parseInt($(this).html()) + 1);
				});
				$(".btn").each(function() {
					var abss = $(this).attr("meid");
					if(abss == name) {
						$(this).attr('onclick', "tusi('您已提交过了');");
						$(this).css("color", "#fff");
						$(this).addClass("btnc");
						$(this).html("谢谢");
					}
				});
			};
			if(d.nextfun) eval(d.nextfun + '("' + name + '","' + d.nextfunpar + '")');
		}
	})
}

function lookmore() {
	tusi("向上滑动查看更多");
}

